    "2016-10-07T14:55:21.331663",nt"name": "minimum-data-set-q1a-report",nt"isopen":
    true,nt"url": null,nt"notes": "<p>The MDS Q1a report summarizes, by state
    and county, percentages of residents that answered Yes to Q1a - Residents expresses
    or indicates preference to return to the community.<br />nThe source of these counts
    is the residents MDS assessment record. The MDS assessment information for each
    active nursing home resident is consolidated to create a profile of the most recent
    standard information for the resident. MDS Q1a Report counts may differ slightly
    from the MDS Active Resident Information Report counts due to residents being dropped
    when county codes on the provider table are missing.</p>n",nt"license_title":
